import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";

function createNote(note) {
  return (
    <Note 
        key={note.key}


    />
  );
}


function App(){
    return <div>
                <Header />
                <Note />
                <Footer />
            </div>;
}

export default App;
